let appendTable = () => {
  
  sortByCategory();

  
  let tableHtml = "<table border='1'><tr><th>Name</th><th>Rating</th><th>Category</th><th>Image</th></tr>";

  
  for (let i = 0; i < films.length; i++) {
    let film = films[i];
    tableHtml += `
      <tr>
        <td>${film.name}</td>
        <td>${film.rating}</td>
        <td>${film.category}</td>
        <td><img src="${film.image}" alt="${film.name}" width="50"></td>
        <td><button class="like-btn" data-index="${i}">Like</button></td>
      </tr>`;
  }

  
  tableHtml += "</table>";

  
  $("#container").append(tableHtml);
};

let sortByCategory = () => {
  films.sort((a, b) => {
    let categoryA = a.category.toLowerCase();
    let categoryB = b.category.toLowerCase();

    if (categoryA < categoryB) {
      return -1;
    }
    if (categoryA > categoryB) {
      return 1;
    }
    return 0;
  });
};

$(".like-btn").click(function () {
  let index = $(this).data("index");
  likeFilm(index);
});

