    let favorites = [];

    let addfavoritFilm = (name, rating, category, image) => {
      let obj = {
        name: name,
        rating: rating,
        category: category,
        image: image,
        likes: 0,
      };
      films.push(obj);
    };

    let appendTableoffavoritfilm = () => {
      sortByCategory();

      let tableHtml = "<table border='1'><tr><th>Name</th><th>Rating</th><th>Category</th><th>Image</th></tr>";

      

      $(".add-to-favorites").click(function () {
        let index = $(this).data("index");
        addToFavorites(index);
      });
    };

    let sortthefavotilistbycat = () => {
      films.sort((a, b) => {
        let categoryA = a.category.toLowerCase();
        let categoryB = b.category.toLowerCase();

        if (categoryA < categoryB) {
          return -1;
        }
        if (categoryA > categoryB) {
          return 1;
        }
        return 0;
      });
    };

    let likeFilms = (index) => {
      films[index].likes = films[index].likes ? films[index].likes + 1 : 1;
      appendTable();
    };

    let addToFavorites = (index) => {
      let film = films[index];
      favorites.push(film);
      updateFavoritesList();
    };

    let updateFavoritesList = () => {
      let favoritesListHtml = "";
      favorites.forEach((film) => {
        favoritesListHtml += `<li>${film.name} 
          <button class="remove-from-favorites" data-name="${film.name}">Remove</button>
          <button class="update-favorite" data-name="${film.name}">Update</button>
        </li>`;
      });
      $("#favorites-list").html(favoritesListHtml);

      $(".remove-from-favorites").click(function () {
        let name = $(this).data("name");
        removeFromFavorites(name);
      });

      $(".update-favorite").click(function () {
        let name = $(this).data("name");
        openModalForUpdate(name);
      });
    };

    let removeFromFavorites = (name) => {
      favorites = favorites.filter((film) => film.name !== name);
      updateFavoritesList();
    };

    let openModalForUpdate = (name) => {
      let filmToUpdate = favorites.find((film) => film.name === name);
      $("#film-name").val(filmToUpdate.name);
      $("#film-rating").val(filmToUpdate.rating);
      $("#film-category").val(filmToUpdate.category);
      $("#film-image").val(filmToUpdate.image);
      $("#modal").show();
      $("#update-favorite").off("click").on("click", function () {
        updateFavorite(name);
      });
    };

    let updateFavorite = (name) => {
      let filmToUpdateIndex = favorites.findIndex((film) => film.name === name);
      favorites[filmToUpdateIndex] = {
        name: $("#film-name").val(),
        rating: $("#film-rating").val(),
        category: $("#film-category").val(),
        image: $("#film-image").val(),
      };

      
      $("#modal").hide();

      
      updateFavoritesList();
    };

    
    appendTable();
    $("#manage-favorites-btn").click(function () {
      
      $("#modal").show();
    });

  
    $("#close-modal").click(function () {
      
      $("#modal").hide();
    });

    
    $("#add-to-favorites").click(function () {
    
      let name = $("#film-name").val();
      let rating = $("#film-rating").val();
      let category = $("#film-category").val();
      let image = $("#film-image").val();

      addFilm(name, rating, category, image);
      addToFavorites(films.length - 1);

      $("#modal").hide();
    });



